geolocator = Nominatim(user_agent="capstoneproject")
for i in address: 
    location = geolocator.geocode(i)

    if location is None: 
        location = geolocator.geocode("{},Toronto,Ontario,Canada".format(i))
    if location is None: 
        print("The location data of {} is not available!".format(i))
    else:
        latitude = location.latitude
        longitude = location.longitude
        df_Toronto = df_Toronto.append({'Neighborhood': i,
                                          'Latitude': latitude,
                                          'Longitude': longitude}, ignore_index=True)
